import React, { Component } from "react";
import ReactDOM from 'react-dom';
import logo from '../acons3.png';

class Recipients extends React.Component {

    state = {
        isLoading: true,
        groups: []
    };

    async componentDidMount() {
        const response = await fetch('/api/recipients/');
        const response2 = await fetch('/api/details/');
        const body = await response.json();
        const body2 = await response2.json();
        this.setState({ recipients: body, isLoading: false });
        this.setState({ details: body, isLoading2: false });
    }




    render() {
        const { recipients, isLoading } = this.state;
        const { details, isLoading2 } = this.state;

        if (isLoading) {
            return <p>Loading...</p>;
        }

        return (
            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <div className="App-intro">
                        <h2>Recip List</h2>
                        {recipients.map(recipients =>
                            <div key={recipients.pk_recipient_id}>
                                <td>{recipients.pk_recipient_id==1? "Hello": "No"}</td>
                            </div> 
                        )}
                    </div>
                    <div className="App-intro">
                        <h2>Details List</h2>
                        {details.map(details =>
                            <div key={details.pk_details_id}>
                                <td>{details.pk_details_id==1? "Hello": "No"}</td>
                            </div> 
                        )}
                    </div>
                </header>
            </div>
        );
    }
}

export default Recipients;
